import React, { useState } from "react";
import "../src/App.css";
import Form from "./components/Form";
import List from "./components/List";

const App = () => {
  const [users, setUsers] = useState([]);

  return (
    <div className="App">
      <h1>User Registration Form</h1>
      <Form addUser={(user) => setUsers([...users, user])} />

      <h2>User List</h2>
      <List users={users} />
    </div>
  );
};

export default App;
